"use strict";module.exports={name:"stats",description:"Displays various stats about the bot.",cooldown:0,guildOnly:!1,execute:function(r){var e=[r.client.shard.fetchClientValues("guilds.cache.size"),r.client.shard.broadcastEval("this.guilds.cache.reduce((prev, guild) => prev + guild.memberCount, 0)")];Promise.all(e).then(function(e){var t=e[0].reduce(function(e,t){return e+t},0),n=e[1].reduce(function(e,t){return e+t},0);return r.channel.send("Server count: ".concat(t,"\nMember count: ").concat(n,"\nCurrent server is: ").concat(r.guild.name))}).catch(console.error)}};